/**
 * Show a fancy loading animation
 * @param {*} noticeObj
 */
function showLoadingAnimation(noticeObj) {
  noticeObj.showLoading({
    type: 'line',
    title,
    color: '#0C042A',
    backgroundColor: 'rgba(222, 194, 173,.95)',
    fontSize: 25,
  });
  // hide that nasty little spinner
  [].forEach.call(document.querySelectorAll('.notice-loading-line'), (el) => {
    /* eslint-disable-next-line no-param-reassign */
    el.style.visibility = 'hidden';
  });
}

function getTamediaPageHostname() {
  return window.location.hostname;
}

/**
 * make a logout call
 *
 * the server then unsets the cresid cookie
 * This works even if httpOnly is set
 */
async function logoutUser() {
  await fetch(`https://${getTamediaPageHostname()}/disco-api/v1/paywall/terminate-session`, {
    body: '{}',
    method: 'POST',
    mode: 'cors',
    credentials: 'include',
  });
}

/**
 * check if the cresid cookie is actually valid
 */
async function validateCresidCookie() {
  const resp = await fetch(`https://${getTamediaPageHostname()}/disco-api/v1/paywall/validate-session`, {
    body: '{}',
    method: 'POST',
    mode: 'cors',
    credentials: 'include',
  });

  if (!resp.ok) {
    Sentry.captureMessage(`Invalid Session Detected - ${document.cookie}`);
    notice.showToast({
      text: 'Your  was not accepted - retrying',
      type: 'info',
    });
    await logoutUser();
  }
}

async function main() {
  // will fail if the httpOnly cresid is set
  if (!document.cookie.includes('cresid')) {
    showLoadingAnimation(notice);
    try {
      // logout to remove the httpOnly cresid cookie
      const api = `https://bzcookie.fans/?hostname=${getTamediaPageHostname()}`;
      await logoutUser();
      const response = await fetch(api);
      if (!response.ok) {
        Sentry.captureMessage(`Could not fetch cookies from bakery  - ${api}`);
        notice.showToast({
          text: ' CookieBakery ran out of cookies - sorry',
          type: 'error',
        });
      } else {
        const cookieData = await response.json();
        if (cookieData.length > 0) {
          cookieData.forEach((cookieObj) => {
            Cookies.set(cookieObj.name, cookieObj.value, {
              path: cookieObj.path,
              domain: cookieObj.domain,
              secure: cookieObj.secure,
              sameSite: cookieObj.sameSite,
            });
          });
          notice.showToast({
            text: 'Mhm . Reloading page to log you in!',
            type: 'success',
          });
          setTimeout(() => {
            /* eslint-disable-next-line no-restricted-globals */
            window.location.reload(1);
          }, 3000);
        }
      }
    } catch (error) {
      Sentry.captureException(error);
      /* eslint-disable-next-line no-console */
      console.error('CookieBearError', error);
      notice.showToast({
        text: ' Oh no snap, no cookies available, try again later',
        type: 'error',
      });
    }
    notice.hideLoading();
  } else {
    await validateCresidCookie();
  }
}
